export class Admin {
  constructor(id, name, _token, _tokenExpireDate) {
    this.id = id;
    this.name = name;
    this._token = _token;
    this._tokenExpireDate = _tokenExpireDate;
  }

  get token() {
    if (!this._tokenExpireDate || new Date() > this._tokenExpireDate) {
      return null;
    }

    return this._token;
  }

}
